import './App.scss';
import React from "react";
import RegistrationPage from "./Pages/Registration/Registration";
import MainPage from "./Pages/MainPage/MainPage";
import Photo from "./Pages/Gallery/Photo";
import Delivery from "./Pages/Delivery/Delivery";
import Constructor from "./Pages/Constructor/Constructor";
import Offer from "./Pages/Offer/Offer"
import {Route, BrowserRouter} from "react-router-dom";
import PrivateOffice from "./Pages/Private office/PrivateOffice";
import ConstructorFrontTitle from "./Pages/ConstructorFrontTitle/ConstructorFrontTitle";

function App() {
    return (
        <BrowserRouter>
            <div className="wrapper">
                <Route path="/MainPage" render = {() => <MainPage/>} />
                <Route path="/RegistrationPage" render ={RegistrationPage}/>
                <Route path="/Photo" render ={Photo}/>
                <Route path="/Delivery" render ={Delivery}/>
                <Route path="/Constructor" render ={Constructor}/>
                <Route path="/Offer" render ={Offer}/>
                <Route path="/PrivateOffice" render ={PrivateOffice}/>
                <Route path={"/ConstructorFrontTitle"} render ={ConstructorFrontTitle}/>
            </div>
        </BrowserRouter>
    );
}

export default App;
